var GoalListVue=new Vue({el:"#goal-list-vue",data:{goals:[],msnry:{}},watch:{},mounted:function(){this.load().then(function(){})},methods:{load:function(){return sendAjax("/Goal/GetGoals",null,"GET").then(function(n){n.isOk==!0&&(GoalListVue.goals=n.goals,setTimeout(function(){GoalListVue.msnry&&GoalListVue.msnry.destroy!=undefined&&GoalListVue.msnry.destroy();GoalListVue.msnry=new Masonry("#goals",{itemSelector:".masonry-item:not(.d-none)",columnWidth:".masonry-item-sizer",originLeft:!0,horizontalOrder:!0})},100))})},getDateByFormat:function(n,t){return GetDateByFormat(n,t)},addMoney:function(n,t){GoalEditVue.addMoney(n,t)},edit:function(n){GoalEditVue.edit(n)},reloadView:function(){setTimeout(function(){GoalListVue.msnry.layout()},15)},remove:function(n){return ShowLoading("#goal_"+n.id),$.ajax({type:"POST",url:"/Goal/Remove",data:JSON.stringify(n),context:n,contentType:"application/json",dataType:"json",success:function(t){n.isDeleted=t.isOk;HideLoading("#goal_"+n.id)}})},recovery:function(n){return ShowLoading("#goal_"+n.id),$.ajax({type:"POST",url:"/Goal/Recovery",data:JSON.stringify(n),context:n,contentType:"application/json",dataType:"json",success:function(t){n.isDeleted=!t.isOk;HideLoading("#goal_"+n.id)}})}}});